package com.zenith.livinghistory.api.zenithlivinghistoryapi.controller;import com.zenith.livinghistory.api.zenithlivinghistoryapi.request.SignInRequest;import com.zenith.livinghistory.api.zenithlivinghistoryapi.request.SignUpRequest;import com.zenith.livinghistory.api.zenithlivinghistoryapi.services.AuthenticationService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.http.HttpStatus;import org.springframework.http.ResponseEntity;import org.springframework.web.bind.annotation.RequestBody;import org.springframework.web.bind.annotation.RequestMapping;import org.springframework.web.bind.annotation.RequestMethod;import org.springframework.web.bind.annotation.RestController;@RestController@RequestMapping("api/v1/auth/")public class AuthenticationController {    private AuthenticationService authenticationService;    @Autowired    public AuthenticationController(AuthenticationService authenticationService) {        this.authenticationService = authenticationService;    }    @RequestMapping(method = RequestMethod.POST, value = "/signup")    public ResponseEntity<Void> signup(@RequestBody SignUpRequest request) {        return new ResponseEntity<>(HttpStatus.NOT_IMPLEMENTED);    }    @RequestMapping(method = RequestMethod.POST, value = "/signin")    public ResponseEntity<Void> signup(@RequestBody SignInRequest request) {        return new ResponseEntity<>(HttpStatus.NOT_IMPLEMENTED);    }}